import React from 'react';


function Modal({ setOpenModal }){
  const data = [
    {
        id:1,
        name: 'Doctor Name : DR John Doe',
        specialization: 'Specialization : Obstetrics and Gynecologist',
        time: 'Time : 16.30 (24 hrs)',
    },
  ];
    return(
        <div className='modelBackground'>
            <div className='modelContainer'>
                <div className='titleCloseBtn'>
                <button
            onClick={() => {
              setOpenModal(false);
            }}
          >
            x
          </button>
                </div>
                <div className='model-title'>
                <h5>Are You Sure You Want To Continue?</h5>
                </div>
                {data.map((values)=>{
                const {id, name, specialization, time}=values;
                   return(

                <div className="modelBody" key={id}>
                    <p>{name} {specialization}</p>
                    {/* <p>{specialization}</p>
                    <p>{time}</p> */}
                </div>
                )
              })}
                <div className='modelFooter'>
                <button
            onClick={() => {
              setOpenModal(false);
            }}
            id="cancelBtn"
          >
            Cancel
          </button>
          <button>Continue</button>
                </div>
            </div>
        </div>
    );
}

export default Modal;
